import Vue from 'vue'
import VueRouter from 'vue-router'
import SignIn from '../views/SignIn.vue'
import HomePage from '../views/HomePage.vue'
import NotFound from '../views/NotFound.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'homepage',
    component: HomePage
  }, 
  {
    path: '/signin',
    name: 'sign-in',
    component: SignIn
  }, 
  {
    path: '/*',
    name: 'sign-in',
    component: NotFound
  }
]

const router = new VueRouter({
  routes
})

export default router
